import React from 'react';
import { Steps } from 'antd';

const { Step } = Steps;
const StepComponent = () => {
    return (
        <Steps progressDot  current={1}>
            <Step title="Cài đặt thông tin cửa hàng" />
            <Step title="Cài đặt vận chuyển" />
            <Step title="Đăng bán sản phẩm" />
        </Steps>
    );
}

export default StepComponent;
